  font-weight: 400;
  font-size: 18px;
  text-align: center;
  margin-top: 40px;
  line-height: 27px;
  margin-bottom: 48px;
}

.btn-msg {
  display: block;
  margin: 0 auto;
  background-color: #000;
  color: #fff;
  width: 180px;
  border-radius: 25px;
  padding: 7px 22px;
  margin-bottom: 80px;
  font-weight: 400;
  font-size: 18px;
  border: none;
  transition: 0.3s all;
}

.btn-msg:hover {
  background: none;
  border: solid 1px cornflowerblue;
  color: #000;
}

.socials-list {
  display: flex;
  justify-content: center;
}

.socials-item {
  margin-left: 62px;
}

.socials-item:first-child {
  margin-left: 0px;
}

.socials-desc {
  text-align: center;
  color: #828282;
  font-weight: 400;
  font-size: 14px;
  line-height: 21px;
  margin-top: 41px;
}
/* Section footer end*/

/* Form style start */
.form-group {
  opacity: 0;
  visibility: hidden;
  width: 100vw;
  height: 100vh;
