.show-form {
  opacity: 1;
  visibility: visible;
  pointer-events: initial;
  background: linear-gradient(
    180deg,
    rgba(53, 66, 103, 0.0001) 0%,
    #151824 107.04%
  );
  transition: opacity 200ms ease-in-out, visibility 200ms ease-in-out;
  z-index: 20;
}

.form {
  width: 300px;
  height: 300px;
  padding: 15px;
  background-color: #ffffff;
  margin: 0 auto;
  border-radius: 10px;
