  text-align: center;
  margin-top: 15px;
}

label {
  display: flex;
  margin-bottom: 8px;
}

input {
  width: 100%;
  border-bottom: solid 1px black;
  padding-left: 10px;
  padding: 10px;
}

textarea {
  width: 100%;
  resize: none;
  padding: 15px;
  margin-bottom: 20px;
  border-bottom: solid 1px black;
}

.btn-submit {
  width: 160px;
  padding: 5px;
  display: block;
  margin: 0 auto;
  border-radius: 4px;
  transition: 0.2s all;
}

.btn-submit:hover {
  background-color: #000;
  color: #f1f1f1;
}
